import { React } from "react";
import {
  Header,
  Footer,
  HomeOverview,
  Drawer,
} from "../../components/HomePage";
import "./styles.css";

const Home = () => {
  return (
    <>
      <Header />
      <div class="home-page-container">Hello</div>
      <Footer />
    </>
  );
};

export default Home;
